INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("受け取ることができる\n報酬があるようです\n確認してみてください", "2030/01/01 14:59:59", 0.0, 1, "カリン", 63, 2.801, 1, "2025/01/31 12:00:00", -416.5, 2, 3, 190801, 1000003);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("報酬がもらえますよ！\nチェックしてみてください", "2030/01/01 14:59:59", 0.0, 2, "カリン", 63, 0.0, 1, "2025/01/31 12:00:00", -416.5, 2, 4, 190801, 1000004);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2030/01/01 14:59:59", 0.0, 2, "カリン", 64, 2.12, 1, "2025/01/31 12:00:00", -363.0, 1, 5, 190801, 1000005);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "2030/01/01 14:59:59", 0.0, 1, "カリン", 64, 1.68, 1, "2025/01/31 12:00:00", -363.0, 2, 6, 190801, 1000006);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2030/01/01 14:59:59", 0.0, 2, "カリン", 64, 2.33, 1, "2025/01/31 12:00:00", -363.0, 1, 7, 190801, 1000007);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", -6.0, 3, "ラビリスタ", 61, 5.18, 10201, "2025/01/31 12:00:00", -285.0, 7, 101, 133701, 1020101);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", -2.0, 1, "クリスティーナ", 61, 8.77, 10201, "2025/01/31 12:00:00", -285.0, 2, 201, 133901, 1020102);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", 0.0, 6, "ネネカ", 61, 15.5, 10201, "2025/01/31 12:00:00", -285.0, 1, 301, 133801, 1020103);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", 0.0, 2, "ランファ", 61, 9.061, 10202, "2025/02/28 12:00:00", -285.0, 5, 101, 134301, 1020201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", 0.0, 1, "チカ", 61, 7.699, 10202, "2025/02/28 12:00:00", -285.0, 2, 201, 134401, 1020202);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", 0.0, 1, "アオイ", 61, 8.595, 10203, "2025/03/31 12:00:00", -285.0, 2, 101, 134601, 1020301);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", 0.0, 1, "クローチェ", 61, 7.758, 10203, "2025/03/31 12:00:00", -285.0, 2, 201, 134501, 1020302);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2030/01/01 14:59:59", 0.0, 2, "ルイズマリー", 61, 7.0, 10204, "2025/04/30 12:00:00", -285.0, 6, 101, 132302, 1020401);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2030/01/01 14:59:59", 0.0, 1, "イロハ", 61, 7.904, 10204, "2025/04/30 12:00:00", -285.0, 2, 201, 132402, 1020402);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES ("ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2030/01/01 14:59:59", 0.0, 4, "ソノ", 61, 8.487, 10204, "2025/04/30 12:00:00", -285.0, 2, 301, 132502, 1020403);
